			"text": "\"사람들은 그걸 모르잖아요. 늙어보질 않았으니까. 그래서 나중에 나중에 하죠. 좀 더 벌고 모으고 자식도 키워 놓고. 나중에 편히 살면 되니까 지금은 고생하자. 하면서요. 근데 나이가 들면 좋은 것을 봐도 좋은 줄을 몰라요. 모든 것이 희미해요.\"",
